				</div>
			);
		}
		if(this.props.name=="Notifications"){
			return(
				<div>
				  <button class="button">Αρχική Σελίδα</button>
				  <button class="button">Δίκτυο</button>
				  <button class="button">Αγγελίες</button>
				  <button class="button">Συζητήσεις</button>
